// PROPOSTA E ORÇAMENTO DO TRATAMENTO

import React, { useEffect, useState } from 'react';

export default function Document() {

    const [name, setName] = useState('');
    const date = new Date();

    useEffect(() => {
        const nameString = localStorage.getItem('name');
        const name = JSON.parse(nameString);
        setName(name);
    }, []);

    return (
        <div className="bg-white text-center text-black pt-12">
            <div className='text-4xl mb-10'>
                Proposta de tratamento e orçamento
            </div>
            <div>
                <div>Nome</div> <div>{name}</div>
            </div>
            <div>Data: {date.toLocaleDateString()}</div>
            <div>
                <div>Procedimento proposto:</div>
            </div>
        </div>
    )
}
